const Ce_Survey = [
  {
    name: "Tripod",
    info: "It is used to fix the instrument",
    class: "tripod",
  },
  {
    name: "Auto Level Instrument",
    info: "Various parts for leveling",
    class: "avi",
  },
  {
    name: "Cross-Sectional View of Auto-level",
    info: "Automatic level compensation",
    class: "cross",
  },
  {
    name: "Measuring Tape",
    info: "It is used to measure the height of Level",
    class: "mt",
  },
  {
    name: "Benchmark",
    info: "Point whose elevation above sea-level is known.",
    class: "bench",
  },
  {
    name: "Staff",
    info: "Used to determine the elevation from ground point",
    class: "staff",
  },
  {
    name: "Cross-hairs",
    info: "Fine hair in Telescopic Tube.",
    class: "hair",
  },
  {
    name: "Cross-hairs Reading",
    info: "Intersection of cross-hairs for reading",
    class: "read",
  },
];

export default Ce_Survey;
